import React, { useState } from 'react';
import "./Welcome.css";

const Welcome = () => {

    const players = useState(0)

    return (
        <div>
            <h1>Welcome to The FloorGame!</h1>
            <h2>Add players</h2>
            <button onClick={()=> players = players-1}>-</button>
            <p>{players}</p>
            <button>+</button>
        </div>
    );
};

export default Welcome;
